import React, { Component } from "react";
import Slider from "react-slick";
import styled from 'styled-components'
import girl from '../photos/girl.jpg'
import girl2 from '../photos/girl.jpg'
import girl3 from '../photos/girl.jpg'
import girl4 from '../photos/girl.jpg'
import girl5 from '../photos/girl.jpg'
import girl6 from '../photos/girl.jpg'

const Div = styled.div`
width:200px;
height:200px;
background-position:center;
background-repeat:no-repeat;
background-size:cover;

`

export default class Girls extends Component {
    render() {
        const settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 4,
            slidesToScroll: 3
        };
        return (
            <div>
                <div>
                    <h2> Multiple items </h2>
                    <Slider {...settings}>
                        <div>
                            <Div style={{ backgroundImage: `url(${girl})` }}></Div>
                        </div>
                        <div>
                            <Div style={{ backgroundImage: `url(${girl})` }}></Div>
                        </div>

                        <div>
                            <h3>6</h3>
                        </div>
                        <div>
                            <h3>7</h3>
                        </div>
                        <div>
                            <h3>8</h3>
                        </div>
                        <div>
                            <h3>9</h3>
                        </div>
                    </Slider>
                </div>
            </div >
        );
    }
}
